import React, { useEffect, useState, useRef } from "react";
import { Link } from "react-router-dom";
import AuthNavbar from "../Layouts/AuthNavbar";
import AuthFooter from "../Layouts/AuthFooter";
import { isLoggedIn } from "../../utils/helper";
import { Redirect } from 'react-router';
import { listAllCategory } from "../../actions/products";
import * as constants from "../../actions/types";
import { useSelector,useDispatch } from "react-redux";

const UserDashboard = (props) => {
  const dispatch = useDispatch();
  const {productsData} = useSelector(state => state.productsApi);

  const loginData = useSelector(state => state.userLogin);

  useEffect(()=>{
      dispatch(listAllCategory(loginData.token))
  },[]);

  console.log((productsData?.data === undefined) ? 'Yes' : 'No');

  const products = [
  {
    id: 1,
    name: 'Basic Tee',
    href: '#',
    imageSrc: 'https://cdn.pixabay.com/photo/2016/03/05/19/02/hamburger-1238246_960_720.jpg',
    imageAlt: "Front of men's Basic Tee in black.",
    price: '$35',
    color: 'Black',
  },
  {
    id: 2,
    name: 'Basic Tee',
    href: '#',
    imageSrc: 'https://cdn.pixabay.com/photo/2016/03/23/15/00/ice-cream-1274894_960_720.jpg',
    imageAlt: "Front of men's Basic Tee in black.",
    price: '$35',
    color: 'Black',
  },
  {
    id: 3,
    name: 'Basic Tee',
    href: '#',
    imageSrc: 'https://cdn.pixabay.com/photo/2014/04/22/02/56/pizza-329523_960_720.jpg',
    imageAlt: "Front of men's Basic Tee in black.",
    price: '$35',
    color: 'Black',
  },
  {
    id: 5,
    name: 'Basic Tee',
    href: '#',
    imageSrc: 'https://cdn.pixabay.com/photo/2016/03/05/20/07/grilled-1238668_960_720.jpg',
    imageAlt: "Front of men's Basic Tee in black.",
    price: '$35',
    color: 'Black',
  },
  // More products...
]
  return (
    <div>
      <AuthNavbar />
        <div className="container w-full mx-auto my-16 text-center bg-white">
          <div className="bg-white">
            <div className="max-w-2xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:max-w-7xl lg:px-8">
              <h2 className="text-2xl font-extrabold tracking-tight text-gray-900 text-center">Our Categories</h2>
              <div className="mt-6 grid grid-cols-1 gap-y-10 gap-x-6 sm:grid-cols-2 lg:grid-cols-4 xl:gap-x-8">
                {products.map((product) => (
                  <div key={product.id} className="group relative">
                    <div className="w-full min-h-80 bg-gray-200 aspect-w-1 aspect-h-1 rounded-md overflow-hidden group-hover:opacity-75 lg:h-80 lg:aspect-none">
                      <img src={product.imageSrc} alt={product.imageAlt} className="w-full h-full object-center object-cover lg:w-full lg:h-full" />
                    </div>
                    <div className="mt-4">
                      <div>
                        <h3 className="text-sm text-gray-700 text-center">
                        <Link to="/">
                          <span aria-hidden="true" className="absolute inset-0"/> {product.name}
                        </Link>
                        </h3>
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
      <AuthFooter />
    </div>
  )
}

export default UserDashboard;
